import React from 'react';



class Result extends React.Component {
    render() {
        var hits = JSON.parse(JSON.stringify(this.props));
        console.log(`gelen hits ${JSON.stringify(hits)}`);
        if (this.props.show === true && this.props.hits !== undefined) {
            return (
                <div className='container'>
                    <p>
                        {
                            this.props.hits.map((v, key) => {
                                return <h3>{v.firstname}</h3>
                            })
                        }
                    </p>
                </div>
            );
        } else {

            return (
                <div className='container'>
                    <p>
                        sonuc yok..
                    </p>
                </div>
            );
        }
    }
} export default Result;
